// src/pages/admin/StudentIdCardPage.jsx
import React, { useEffect, useState } from 'react';
import { useParams, Link } from 'react-router-dom';
import axios from 'axios';
import AdminLayout from '../../layouts/AdminLayout';

export default function StudentIdCard() {
    const { cif } = useParams();
    const [idCards, setIdCards] = useState([]);
    const [requirements, setRequirements] = useState([]);
    const [pictures, setPictures] = useState([]);

    useEffect(() => {
        const fetchAll = async () => {
            try {
                const [idcRes, reqRes, picRes] = await Promise.all([
                    axios.get('http://localhost:8087/uam-carnet-sys/idcard'),
                    axios.get('http://localhost:8087/uam-carnet-sys/requirement'),
                    axios.get('http://localhost:8087/uam-carnet-sys/picture'),
                ]);
                // filtrado por cif
                setIdCards(idcRes.data.filter(i => i.cif === cif));
                setRequirements(reqRes.data.filter(r => r.cif === cif));
                setPictures(picRes.data.filter(p => p.cif === cif));
            } catch (err) {
                console.error('Error al cargar datos de carnet:', err);
            }
        };
        fetchAll();
    }, [cif]);

    return (
        <AdminLayout>
            <div className="max-w-4xl mx-auto mt-10 p-6 bg-white rounded shadow">
                <h1 className="text-2xl font-bold mb-4">Solicitudes de Carnet de {cif}</h1>

                <Link to="/admin/students" className="text-blue-600 hover:underline mb-6 block">
                    ← Volver a Estudiantes
                </Link>

                {idCards.length === 0 && (
                    <p className="text-gray-500">No hay solicitudes de carnet para este estudiante.</p>
                )}

                {idCards.map((i) => (
                    <div key={i.idCardId} className="border p-6 rounded mb-6">
                        {/* Información básica del estudiante */}
                        <section className="mb-4">
                            <h2 className="text-xl font-semibold mb-2">Información del Estudiante</h2>
                            <p><strong>CIF:</strong> {i.cif}</p>
                            <p><strong>Nombre:</strong> {i.names} {i.surnames}</p>
                            <p><strong>Carrera seleccionada:</strong> {i.selectedDegreeName}</p>
                            <p><strong>Facultad seleccionada:</strong> {i.selectedFacultyName}</p>
                        </section>

                        {/* Detalles de la solicitud */}
                        <section className="mb-4">
                            <h2 className="text-xl font-semibold mb-2">Detalles de la Solicitud</h2>
                            <p><strong>ID Solicitud:</strong> {i.idCardId}</p>
                            <p><strong>Semestre:</strong> {i.semester} {i.year}</p>
                            <p><strong>Fecha de emisión:</strong> {i.issueDate}</p>
                            <p><strong>Fecha de expiración:</strong> {i.expirationDate}</p>
                            <p><strong>Estado:</strong> {i.status}</p>
                            <p><strong>Cita de entrega:</strong> {i.deliveryAppointment}</p>
                            <p><strong>Notas:</strong> {i.notes}</p>
                        </section>

                        {/* Requisito asociado a esta solicitud */}
                        <section className="mb-4">
                            <h2 className="text-xl font-semibold mb-2">Requisito de Pago</h2>
                            <p><strong>ID Requisito:</strong> {i.requirement_id}</p>
                            <p>
                                <strong>Comprobante:</strong>{' '}
                                <a
                                    href={i.payment_proof_url}
                                    target="_blank"
                                    rel="noreferrer"
                                    className="text-blue-600 hover:underline"
                                >
                                    Ver Comprobante
                                </a>
                            </p>
                        </section>

                        {/* Fotografía asociada */}
                        <section>
                            <h2 className="text-xl font-semibold mb-2">Fotografía</h2>
                            <p>
                                <strong>Foto URL:</strong>{' '}
                                <a
                                    href={i.picture_url}
                                    target="_blank"
                                    rel="noreferrer"
                                    className="text-blue-600 hover:underline"
                                >
                                    Ver Foto
                                </a>
                            </p>
                        </section>
                    </div>
                ))}

            </div>
        </AdminLayout>
    );
}
